import './HomeTab.css';

function HomeTab() {
  return (
    <div className="homeTab">
      <img className="spaceShip" src="spaceShip.png" alt=""></img>
      <div className="borderUnderline">
        <div className="name">Isidore     Mones.</div>
      </div>
      <div className="header">Engineering and Computer Science</div>
      <div className="borderDiv">
        <img className="border" src="seafoamborder.png" alt=""></img>
      </div>
    </div>
  );
}

export default HomeTab;
